import React from "react";
import { useParams } from "react-router-dom";
const UserLogin = () => {
  let params = useParams();
  // console.log(params.id);

  let usersId = params.id;

  return (
    <>
      <div>UserLogin

        <h1>{usersId}</h1>
      </div>
    </>
  );
};

export default UserLogin;
